data.value:
Copy/Backup event logs: (First Important Step) C:\> wevtutil epl Security C:\<BACKUP PATH>\mylogs.evtx C:\> wevtutil epl System C:\<BACKUP PATH>\mylogs.evtx C:\> wevtutil epl Application C:\<BACKUP PATH>\mylogs.evtx
Get list of logs remotely: Ref. https://technet.microsoft.com/enus/sysinternals/psloglist.aspx C:\> psloglist \\<REMOTECOMPUTER> -accepteula -h 12 -x
Clear all logs and start a baseline log to monitor: PS C:\> wevtutil el I Foreach-Object {wevtutil cl "$_"}
List log filenames and path location: C:\> wmic nteventlog get path,filename,writeable
Take pre breach log export: PS C:\> wevtutil el I ForEach-Object{Get-Eventlog -Log "$_" I Export-Csv -Path (:\<BASELINE LOG>,csv -Append}
Take post breach log export: PS C:\> wevtutil el I ForEach-Object{Get-EventLog -Log"$_" I Export-Csv -Path C:\<POST BASELINE LOG>,CSV -Append}
Compare two files baseline and post breach logs: PS C:\> Compare-Object -ReferenceObject $(GetContent "C:\<PATH TO FILE>\<ORIGINAL BASELINELOGS>.txt") -DifferenceObject $(Get-Content "C:\<PATH TO FILE>\<POST BASELINE LOGS>.txt") >> <DIFFERENCES LOG>.txt
This deletes all logs: PS C:\> wevtutil el I Foreach-Object {wevtutil cl "$_"}
